import React, {useState} from "react";
import axios from "axios";

export default function AddBank() {

    const [bankRegID, setBankRegID] = useState("");
    const [bankName, setBankName] = useState("");
    const [mainBranchVenue, setMainBranchVenue] = useState("");
    const [numOfBranches, setNumOfBranches] = useState("");
    const [bankMobile, setBankMobile] = useState("");
    const [bankEmail, setBankEmail] = useState("");
    const [historyOfBank, setHistoryOfBank] = useState("");

    // const [contractIDErr, setContractIDErr] = useState({});
    // const [materialIDErr, setMaterialIDErr] = useState({});


    function sendData(e){
        
        e.preventDefault();
        const isValid = formValidation();

        if(isValid) {
        const newBank ={
            bankRegID,
            bankName,
            mainBranchVenue,
            numOfBranches,
            bankMobile,
            bankEmail,
            historyOfBank
        }

        axios.post("http://localhost:8100/bank/registered_new_bank", newBank).then(()=>{
            alert("New Bank Branch Details Added.");
            window.location = '/All_Branches_Details';
            
        }).catch((err)=>{
            alert(err);
        })
    
        }
    }

    function demofill(){
        setBankRegID("CON2200")
        setBankName("M0014")
        setMainBranchVenue("Rhino Ceiling Sheet (4x4)")
        setNumOfBranches("60")
        setBankMobile("71860")
        setBankEmail("")
        setHistoryOfBank("")
    }

    // const formValidation = () =>{
    //     const contractIDErr = {};
    //     const materialIDErr = {};
    //     let isValid = true;

    //     if(!contractID.includes("CON")){
    //         contractIDErr.contractIdCON = "ContractID should start with 'CON' "
    //         isValid = false;
    //     }

    //     if(!materialID.includes("M")){
    //         materialIDErr.materialIdM = "MaterialID should start with 'M' "
    //         isValid = false;
    //     }

    //     setContractIDErr(contractIDErr);
    //     setMaterialIDErr(materialIDErr);

    //     return isValid;

    // }

    return (
        <div>
            <div>
                {/* <!-- SIDEBAR --> */}
                <section id="sidebar">
                    <a href="#" class="brand">
                        <i class="fa-brands fa-slack fa-flip"></i>
                        <span class="text">CINNAMON</span>
                    </a>
                    <ul class="side-menu top">
                        <li>
                            <a href="#">
                                <i class="fa-solid fa-gauge "></i>
                                <span class="text">Dashboard</span>
                            </a>
                        </li>
                        <li class="active">
                            <a href="#">
                                <i class="fa-solid fa-briefcase fa-beat"></i>
                                <span class="text">Banks</span>
                            </a>
                        </li>
                        <li>
                            <a href="#">
                                <i class="fa-solid fa-dollar-sign"></i>
                                <span class="text">Loan Apply</span>
                            </a>
                        </li>
                        <li>
                            <a href="#">
                                <i class="fa-solid fa-leaf"></i>
                                <span class="text">Estate Owners</span>
                            </a>
                        </li>
                        <li>
                            <a href="#">
                                <i class="fa-solid fa-users"></i>
                                <span class="text">Entrepreneurs</span>
                            </a>
                        </li>
                        <li>
                            <a href="#">
                                <i class="fa-solid fa-address-book"></i>
                                <span class="text">Contact Us</span>
                            </a>
                        </li>
                    </ul>
                    <ul class="side-menu">
                        <li>
                            <a href="#">
                                <i class="fa-solid fa-gear"></i>
                                <span class="text">Settings</span>
                            </a>
                        </li>
                        <li>
                            <a href="#" class="logout">
                                <i class="fa-solid fa-right-to-bracket fa-rotate-180"></i>
                                <span class="text">Logout</span>
                            </a>
                        </li>
                    </ul>
                </section>
                {/* <!-- SIDEBAR --> */}



                {/* <!-- CONTENT --> */}
                <section id="content">
                    {/* <!-- NAVBAR --> */}
                    <nav>
                        <a href="/Bank_Reg_Details" class="nav-link">Bank Details Registration</a>
                        <a href="/All_Branches_Details" class="nav-link">View Bank Details</a>

                        <form action="#">
                                <div class="form-input">
                                    <input type="search" placeholder="Search..." />
                                    <button type="submit" class="search-btn"><i class='bx bx-search' ></i></button>
                                </div>
                            </form>

                        <a href="#" class="notification">
                            <i class='bx bxs-bell' ></i>
                            <span class="num">10</span>
                        </a>
                        <a href="#" class="profile">
                            <img src="assets/images/people.png" />
                        </a>
                    </nav>
                    {/* <!-- NAVBAR --> */}

                    {/* <!-- MAIN --> */}
                    <main>
                        <div class="head-title">
                            <div class="left">
                                <h1>Admin Dashboard</h1>
                                <ul class="breadcrumb">
                                    <li>
                                        <a href="#">Dashboard</a>
                                    </li>
                                    <li><i class='bx bx-chevron-right' ></i></li>
                                    <li>
                                        <a href="#">Bank</a>
                                    </li>
                                    <li><i class='bx bx-chevron-right' ></i></li>
                                    <li>
                                        <a class="active" href="#">Bank Registration</a>
                                    </li>
                                </ul>
                            </div>
                        </div>

                        <div class="table-data">
                            <div class="order">
                                <div class="d-flex justify-content-center mt-3">
                                    <div className="p-5 text-bg-light rounded">
                                        <h1 className='text-center'>Register Bank</h1>
                                        <form className='row g-3 mt-5' onSubmit={sendData}>
                                            <form class="row g-3">
                                                <div class="col-md-6">
                                                    <label for="inputText" class="form-label">Bank Register ID</label>
                                                    <input type="text" class="form-control" id="inputText" name='bankRegID' />
                                                </div>
                                                <div class="col-md-6">
                                                    <label for="inputText" class="form-label">bank's Name</label>
                                                    <input type="text" class="form-control" id="inputText" name='bankName' />
                                                </div>
                                                <div class="col-12">
                                                    <label for="inputText" class="form-label">Main Branch Venue</label>
                                                    <input type="text" class="form-control" id="inputText" placeholder="City or Main town" name='mainBranchVenue' />
                                                </div>
                                                <div class="col-12">
                                                    <label for="inputText" class="form-label">Number of Branches</label>
                                                    <input type="number" class="form-control" id="inputNumber" name='numOfBranches' />
                                                </div>
                                                <div class="col-12">
                                                    <label for="inputText" class="form-label">Bank Telephone Number</label>
                                                    <input type="tel" class="form-control" id="inputNumber" name='bankMobile' />
                                                </div>
                                                <div class="col-md-6">
                                                    <label for="inputEmail" class="form-label">Bank Email</label>
                                                    <input type="email" class="form-control" id="inpuEmail" name='bankEmail' />
                                                </div>
                                                <div class="col-md-6">
                                                    <label for="inputText" class="form-label">History of Bank</label>
                                                    <textarea type="text" class="form-control" id="inputText" name='historyOfBank' rows="2" />
                                                </div>
                                                <div class="col-12">
                                                    <button type="submit" class="btn btn-success">Register Banks</button>
                                                </div>
                                            </form>
                                        </form>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </main>
                    {/* <!-- MAIN --> */}
                </section>
                {/* <!-- CONTENT --> */}
            </div>
        </div>
    )
}
